import React from 'react';
import { Link } from 'react-router-dom';

function SmallMenu({ name }) {
  return (
    <li>
      <Link to={name === '지역별' ? '/mapfoodsh' : ''}>{name}</Link>
    </li>
  );
}

export default SmallMenu;
